import { Switch, Redirect, Route, Link } from 'react-router-dom';

import Users from '../Users';
import NotFound from '../Not found/notFound';
import './app.css';
import { MODE } from '../../constants';

function App() {
  return (
    <div className='App'>
      <div className={'bar'}>
        <Link to='/users'></Link>
      </div>
      <Switch>
        <Redirect exact from='/' to='/users' />

        <Route path='/users'>
          <Users />
        </Route>

        <NotFound />
      </Switch>
    </div>
  );
}

export default App;
